import './Footer.css'; // Si tienes estilos específicos para el footer

const Footer = () => (
    <div className='row'>
        <div className='col-12 d-flex'>
            <h3>NEED HELP?</h3>
            <p>Can't find your current model? <a href="#">Contact us</a></p>  
        </div>
    </div>
);

export default Footer;
